      WW        \n6 Cheetos Puffs 165g                     165       Cheetos   "},"metadata":{}}],"execution_count":115},{"cell_type":"markdown","source":"# Defining Metrics\nI defined metrics on who spends on chips and what drives spends for each customer segment.","metadata":{}},{"cell_type":"code","source":"# Define metrics: Total sales, number of transactions, and average spend per brand\nbrand_metrics <- merged_data %>%\n  group_by(BRAND_NAME) %>%\n  summarise(\n    Total_Sales = sum(TOT_SALES, na.rm = TRUE),\n    Transactions = n(),\n    Avg_Spend_Per_Transaction = mean(TOT_SALES, na.rm = TRUE)\n  )\n\n# View the summary\nhead(brand_metrics)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-03-21T11:06:38.363359Z","iopub.execute_input":"2025-03-21T11:06:38.364808Z","iopub.status.idle":"2025-03-21T11:06:38.411463Z","shell.execute_reply":"2025-03-21T11:06:38.409125Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 4</caption>\n<thead>\n\t<tr><th scope=col>BRAND_NAME</th><th scope=col>Total_Sales</th><th scope=col>Transactions</th><th scope=col>Avg_Spend_Per_Transaction</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>Burger  </td><td> 6831.0</td><td>1564</td><td> 4.367647</td></tr>\n\t<tr><td>CCs     </td><td>18078.9</td><td>4551</td><td> 3.972512</td></tr>\n\t<tr><td>Cheetos </td><td>16884.5</td><td>2927</td><td> 5.768534</td></tr>\n\t<tr><td>Cheezels</td><td>40029.9</td><td>4603</td><td> 8.696481</td></tr>\n\t<tr><td>Cobs    </td><td>70569.8</td><td>9693</td><td> 7.280491</td></tr>\n\t<tr><td>Dorito  </td><td>40352.0</td><td>3185</td><td>12.669388</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 6 × 4\n\n| BRAND_NAME &lt;chr&gt; | Total_Sales &lt;dbl&gt; | Transactions &lt;int&gt; | Avg_Spend_Per_Transaction &lt;dbl&gt; |\n|---|---|---|---|\n| Burger   |  6831.0 | 1564 |  4.367647 |\n| CCs      | 18078.9 | 4551 |  3.972512 |\n| Cheetos  | 16884.5 | 2927 |  5.768534 |\n| Cheezels | 40029.9 | 4603 |  8.696481 |\n| Cobs     | 70569.8 | 9693 |  7.280491 |\n| Dorito   | 40352.0 | 3185 | 12.669388 |\n\n","text/latex":"A tibble: 6 × 4\n\\begin{tabular}{llll}\n BRAND\\_NAME & Total\\_Sales & Transactions & Avg\\_Spend\\_Per\\_Transaction\\\\\n <chr> & <dbl> & <int> & <dbl>\\\\\n\\hline\n\t Burger   &  6831.0 & 1564 &  4.367647\\\\\n\t CCs      & 18078.9 & 4551 &  3.972512\\\\\n\t Cheetos  & 16884.5 & 2927 &  5.768534\\\\\n\t Cheezels & 40029.9 & 4603 &  8.696481\\\\\n\t Cobs     & 70569.8 & 9693 &  7.280491\\\\\n\t Dorito   & 40352.0 & 3185 & 12.669388\\\\\n\\end{tabular}\n","text/plain":"  BRAND_NAME Total_Sales Transactions Avg_Spend_Per_Transaction\n1 Burger      6831.0     1564          4.367647                \n2 CCs        18078.9     4551          3.972512                \n3 Cheetos    16884.5     2927          5.768534                \n4 Cheezels   40029.9     4603          8.696481                \n5 Cobs       70569.8     9693          7.280491                \n6 Dorito     40352.0     3185         12.669388                "},"metadata":{}}],"execution_count":116},{"cell_type":"markdown","source":"# Customer Segmentation Analysis\nI performed a deep dive into customer segments using LIFESTAGE and PREMIUM_CUSTOMER columns.\nI also identified high-value segments based on chip purchasing behavior.\n\nThis analysis will help us understand purchasing patterns based on different life stages and customer premium status, leading to actionable insights.\n\n# Steps for Deep Dive: and Visualization\n- Group by LIFESTAGE and PREMIUM_CUSTOMER: I will summarize total sales, average transaction size, and total number of transactions for each segment.\n- Identify High-Value Segments: These are those segments with the highest total sales or the highest average spend per customer.\n- Visualize the Findings: Create visualizations to make the insights clear.","metadata":{}},{"cell_type":"code","source":"# Load necessary libraries\nlibrary(ggplot2)\n\n# Summarize data by LIFESTAGE and PREMIUM_CUSTOMER\nsegment_analysis <- merged_data  %>%\n  group_by(LIFESTAGE, PREMIUM_CUSTOMER) %>%\n  summarise(\n    Total_Sales = sum(TOT_SALES, na.rm = TRUE),\n    Avg_Transaction_Size = mean(TOT_SALES, na.rm = TRUE),\n    Transaction_Count = n()\n  ) %>%\n  arrange(desc(Total_Sales))\n\n# View the segment analysis summary\nhead(segment_analysis)\n\n# Identify high-value segments by highest Total_Sales and Avg_Transaction_Size\nhigh_value_segments <- segment_analysis %>%\n  filter(Total_Sales > quantile(Total_Sales, 0.75) | Avg_Transaction_Size > quantile(Avg_Transaction_Size, 0.75))\n\n# Visualize total sales by LIFESTAGE and PREMIUM_CUSTOMER with wider bars and slanted x-axis labels\nggplot(segment_analysis, aes(x = LIFESTAGE, y = Total_Sales, fill = PREMIUM_CUSTOMER)) +\n  geom_bar(stat = \"identity\", position = \"dodge\", width = 0.9) +  # Adjust bar width here\n  labs(title = \"Total Sales by Customer Segment (LIFESTAGE & PREMIUM_CUSTOMER)\",\n       x = \"Lifestage\", y = \"Total Sales\") +\n  theme_minimal() +\n  theme(axis.text.x = element_text(angle = 45, hjust = 1))\n\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-03-21T11:06:38.415379Z","iopub.execute_input":"2025-03-21T11:06:38.416782Z","iopub.status.idle":"2025-03-21T11:06:38.820917Z","shell.execute_reply":"2025-03-21T11:06:38.819009Z"}},"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'LIFESTAGE'. You can override using the\n`.groups` argument.\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A grouped_df: 6 × 5</caption>\n<thead>\n\t<tr><th scope=col>LIFESTAGE</th><th scope=col>PREMIUM_CUSTOMER</th><th scope=col>Total_Sales</th><th scope=col>Avg_Transaction_Size</th><th scope=col>Transaction_Count</th></