     876.1      0.6567743\n\nTrial Store: 86Key: <YEARMONTH>\n   YEARMONTH totSales_trial totSales_control percentageDiff\n       <num>          <num>            <num>          <num>\n1:    208902          892.0           507.00      0.7593688\n2:    208903          993.8           483.80      1.0541546\n3:    208904          908.2           475.20      0.9111953\n4:    208905          902.5           495.35      0.8219441\n\nTrial Store: 88Key: <YEARMONTH>\n   YEARMONTH totSales_trial totSales_control percentageDiff\n       <num>          <num>            <num>          <num>\n1:    208902        1355.80           1077.2      0.2586335\n2:    208903        1439.40            999.8      0.4396879\n3:    208904        1449.40           1044.2      0.3880483\n4:    208905        1302.85            945.2      0.3783855\n","output_type":"stream"}],"execution_count":124},{"cell_type":"code","source":"# Step 9: Save Report as PDF\npdf(\"quantium_trial_analysis.pdf\")\nfor (trial_store in trial_stores) {\n  print(plot_list[[as.character(trial_store)]])\n}\ndev.off()","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-03-21T11:06:50.157962Z","iopub.execute_input":"2025-03-21T11:06:50.15943Z","iopub.status.idle":"2025-03-21T11:06:50.586807Z","shell.execute_reply":"2025-03-21T11:06:50.584797Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"<strong>png:</strong> 2","text/markdown":"**png:** 2","text/latex":"\\textbf{png:} 2","text/plain":"png \n  2 "},"metadata":{}}],"execution_count":125},{"cell_type":"markdown","source":"# Summary of Findings & Recommendations for the Category Manager\n## Overview\n\nI analyzed the performance of the trial stores (77, 86, 88) compared to their selected control stores during the trial period (Feb 2089 - May 2089). \nThe evaluation focused on:\n- Total Sales Revenue\n- Total Number of Customers\n- Average Number of Transactions per Customer","metadata":{}},{"cell_type":"markdown","source":"# Key Findings\n## Trial Store 77 vs. Control Store 71\n- The control store's sales are significantly higher than the trial store's throughout the period.\n- The control store sees an initial peak in March 2089, followed by a decline.\n- The trial store remains relatively stable with a slight increase in May 2089.\n  ","metadata":{}},{"cell_type":"markdown","source":"## Trial Store 86 vs. Control Store 260\n- The trial store starts at a higher sales level and experiences a peak in March 2089, followed by a slight decline but remains consistently above the control store.\n- The control store has consistently lower sales and does not show significant variations.\n","metadata":{}},{"cell_type":"markdown","source":"## Trial Store 88 vs. Control Store 178\n- The trial store's sales are higher than the control store's throughout the period.\n- The trial store peaks in March and April 2089, then declines in May 2089.\n- The control store follows a gradual downward trend.","metadata":{}},{"cell_type":"markdown","source":"## Key Insights:\n- Trial stores generally perform better than their control stores, except for Trial Store 77, which lags behind.\n- There is a seasonal pattern, with sales peaking in March 2089 across most trial stores before declining.\n- The impact of the trial may be more effective for some stores than others, indicating that factors such as location, promotions, or customer demographics may influence success.","metadata":{}},{"cell_type":"markdown","source":"## Recommendations for the Category Manager\nBased on the total sales trends observed across the trial and control stores, the following strategic recommendations are suggested:\n\n- Evaluate the Success of the Trial\nTrial Stores 86 and 88 outperformed their control stores consistently, indicating a positive impact of the trial.\nTrial Store 77, however, showed weaker performance, suggesting the trial was not as effective in this location.\nConduct a deep dive analysis into store-specific factors (e.g., demographics, customer behavior, and in-store execution) to understand the variations.\n- Optimize the Rollout Strategy\nFocus on scaling the trial strategy to stores similar to Trial Store 86 and 88, as they showed strong sales growth.\nInvestigate why Trial Store 77 underperformed—this could be due to store size, customer preferences, or ineffective local marketing.\nConsider modifying or discontinuing the trial strategy for locations that do not show significant improvement.\n- Leverage Peak Sales Periods\nSales peaked in March 2089, followed by a decline—this suggests a seasonal effect or temporary promotional success.\nPlan targeted promotions around high-performing months to sustain sales momentum.\nIf March’s peak was due to promotional activity, explore ways to make those campaigns more sustainable and repeatable.\n- Conduct Further Analysis\nCustomer Segmentation Analysis: Understand if certain customer segments contributed more to trial store sales.\nPrice Elasticity Testing: Assess if pricing strategies in trial stores influenced the sales uplift.\nMarketing Attribution: Identify the impact of marketing initiatives on the trial’s success.\n- Decision on Full-Scale Implementation\nIf the trial was intended as a test for a full-scale rollout, prioritize expansion to locations similar to successful trial stores while refining strategies for underperforming ones.\nIf Trial Store 77’s performance was due to external factors, consider testing different promotional or pricing strategies before rolling out further.\n\n## Conclusion\nThe trial program appears partially successful, with Trial Stores 86 and 88 showing strong results. A targeted expansion strategy should be pursued, focusing on stores where similar success is likely, while refining the approach for underperforming locations.","metadata":{}},{"cell_type":"code","source":"# Load required libraries\ninstall.packages(\"ggrepel\")    # For callout annotations\n\nlibrary(ggrepel)\n\n# Load dataset\ndata <- read.csv(\"merged_data.csv\")  # Update path if needed\n\n# Convert date column to Date format (assuming column is 'DATE')\ndata$DATE <- as.Date(data$DATE, format = \"%Y-%m-%d\")\n\n# Aggregate total sales per week\ndata$Week <- floor_date(data$DATE, \"week\")  # Extract the week\nweekly_sales <- aggregate(TOT_SALES ~ Week, data, sum)\n\n# Identify the week with the lowest sales\nmin_sales <- weekly_sales[which.min(weekly_sales$TOT_SALES), ]\n\n# Create a line plot\np <- ggplot(weekly_sales, aes(x = Week, y = TOT_SALES)) +\n  geom_line(color = \"steelblue\", linewidth = 1.2) +  # Line plot\n  geom_point(data = min_sales, aes(x = Week, y = TOT_SALES), color = \"red\", size = 3) +  # Highlight dip\n  geom_text_repel(data = min_sales, aes(x = Week, y = TOT_SALES, label = paste(\"Dip in Sales:\", TOT_SALES)), \n                  color = \"red\", size = 5, fontface = \"bold\") +  # Add callout text\n  labs(title = \"Weekly Sales Trend\",\n       x = \"Week\",\n       y = \"Total Sales\",\n       caption = \"Callout at the dip in sales\") +\n  theme_minimal()\n\n# Display the plot \nprint(p)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-03-21T11:06:50.590291Z","iopub.execute_input":"2025-03-21T11:06:50.591829Z","iopub.status.idle":"2025-03-21T11:07:14.609728Z","shell.execute_reply":"2025-03-21T11:07:14.60777Z"}},"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2CTdf4H8M+Tvdqme9JCF1BKC2VvFXAg7sO9ztOfesN1nqic+9yeHo67U+/O\nc4ADBQERFZS9CrRQCoW2dNE9kzZ7Pb8/wpXkeZI0nQnt+/UXPEnTb5rkyfv5fBfDsiwBAAAA\nwPlPEOgGAAAAAMDAQLADAAAAGCYQ7AAAAACGCQQ7AAAAgGECwQ4AAABgmECwAwAAABgmEOwA\nAAAAhgkEOwAAAIBhYuQGu+rvLmUYRqzIcPBu2nV7JsMwYkW6hbd48777sxiGCR316AC25KOx\nkQzDrG4x+LhP0avTGIZZuL6qn7/Lbqr598uPLJ6dEx0eKhZJQiMTplxw5VPvfKW193qd6oFq\nkm/5D09k/HDl0ZZBbYY